import shqpr from '../components/assets/shqpr.jpg'


const Section2 = () => {
 return (
    <div style={{ width: '100%', margin: '0 auto', 
    position: 'relative', backgroundRepeat: 'no-repeat' }}>
    <div style={{ backgroundImage: `url(${shqpr})`, textAlign: 'center',
    backgroundRepeat: 'no-repeat', backgroundPosition: 'center center', }}>
        <h1 style={{ paddingBottom: '400px' }}>Hartimin e të gjitha dokumenteve të nevojshme 
        për regjistrimin e biznesit në Shqipëri, përgatitjen e Rezolutës së Bordit të Drejtorëve, 
        Prokurës dhe Dokumenteve të tjera të kërkuara për këtë qëllim;</h1>
        <h3>Doni</h3>
    </div>
    </div>
 )
}

export default Section2;
